========

Sidewalks of London, also known as St. Martin's Lane, is a 1938 British,
black-and-white, comedy drama starring Charles Laughton as a busker or street
entertainer who teams up with a talented pickpocket, played by Vivien Leigh
The Film co-stars Rex Harrison and Tyrone Guthrie in a rare acting appearance.
It also features Ronald Shiner as the Barman (uncredited). It was produced by
Mayflower Pictures Corporation.

